import React from 'react';

function All() {
    const [all, setAll] = React.useState();

    React.useEffect(() => {
        fetch(`${process.env.REACT_APP_SERVER_URL}teachers/`)
            .then(res => res.json())
            .then(data => setAll(data))
    }, [])

    return <div>
        {all ? all.forEach(element => {
            console.log(element);
            return <p>{element.name}</p>
        }) : ""}
    </div>
}


export default All;
